        protected override void Seed(ORS.API.AuthContext context)
        {
            if (!context.Roles.Any(r => r.Name == "AppAdmin"))
            {
                var store = new RoleStore<IdentityRole>(context);
                var manager = new RoleManager<IdentityRole>(store);
                var role = new IdentityRole { Name = "AppAdmin" };

                manager.Create(role);
            }
            if (!context.Roles.Any(r => r.Name == "company"))
            {
                var store = new RoleStore<IdentityRole>(context);
                var manager = new RoleManager<IdentityRole>(store);
                var role = new IdentityRole { Name = "company" };

                manager.Create(role);
            }
            if (!context.Roles.Any(r => r.Name == "jobseeker"))
            {
                var store = new RoleStore<IdentityRole>(context);
                var manager = new RoleManager<IdentityRole>(store);
                var role = new IdentityRole { Name = "jobseeker" };

                manager.Create(role);
            }

            if (!context.Users.Any(u => u.UserName == "janiclassical@gmail.com"))
            {
                var store = new UserStore<Admin>(context);
                var manager = new UserManager<Admin>(store);
                var user = new Admin { UserName = "janiclassical@gmail.com", Email = "janiclassical@gmail.com", EmailConfirmed=true };

                manager.Create(user, "appadmin");
                manager.AddToRole(user.Id, "AppAdmin");
            }
            if (context.Clients.Count() > 0)
            {
                return;
            }

            context.Clients.AddRange(BuildClientsList());
            context.Countries.AddRange(CreateCountries());
            context.SaveChanges();
        }

